import React from 'react';
import Navbar from './Navbar'; // Add this line
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-left">
        <h1>[Your Name]</h1>
        <p>Your Tagline Here</p>
      </div>
      <Navbar />
    </header>
  );
};

export default Header;
